  [],\n\t\"num_tags\": 0,\n\t\"name\": \"2012-georgia-department-of-natural-resources-dnr-lidar-baldwin-hancock-morgan-and-putnam-counti\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"LiDAR data is a remotely sensed high resolution
  elevation data collected by an airborne platform. The LiDAR sensor uses a combination
  of laser range finding, GPS positioning, and inertial measurement technologies.
  The LiDAR systems collect data point clouds that are used to produce highly detailed
  Digital Elevation Models (DEMs) of the earth's terrain, man-made structures, and
  vegetation. The task required the LiDAR data to be collected at a nominal pulse
  spacing (NPS) of 1.0 meter. The final products include full classified LAS, hydrologically
  flattened four (4) foot pixel raster DEM's of the bare earth surface in IMG Format,
  and hydrologically flattened breaklines in gdb format. Links to the hydrologically
  flattened 4 foot pixel raster bare earth DEMs and the hydrologically flattened breaklines
  are provided in the Supplemental Information section below. This metadata record
  describes the classified LAS files. The classifications of lidar data available
  from the Digital Coast are: 1 Unclassified 2 Ground 7 Noise 9 Water 10 Ignored Ground
  16 Overlap Water 17 Overlap Unclassified 18 Overlap Ground This lidar data set also
  includes lidar intensity values. Intensity information is captured from the reflective
  surface pulse and indicates the relative energy returned to the sensor, as compared
  to the energy transmitted. The intensity image is not calibrated or normalized but
  indicates differences in energy absorption due to the interaction of the surface
  materials with laser energy, at the wavelength transmitted by the sensor. This lidar
  data set covers 1455 sq miles in Baldwin, Hancock, Morgan, and Putnam counties in
  Georgia. The data were collected Dec 19, 22, 28, 30, 2012 and January 4, 5, 2013.
  The LiDAR data were collected to meet Fundamental Vertical Accuracy (FVA) Root Mean
  Square Error (RMSE) of 18.0 cm or better at a 95% confidence level, so that when
  combined with breaklines, the data adequately supports the generation of two (2)
  foot FEMA compliant contours. The final LiDAR data were delivered in 5,000 ft x
  5,000 ft tiles using NAD 1983(2011), Georgia State Plane Coordinate System, West
  Zone, and expressed in US Survey Feet for Morgan and Putnam Counties. The final
  LiDAR data was delivered in 5,000 ft x 5,000 ft tiles using NAD 1983(2011), Georgia
  State Plane Coordinate System, East Zone, and expressed in US Survey Feet for Baldwin
  and Hancock Counties. The vertical datum used for this survey is North American
  Vertical Datum 1988 (NAVD88), and expressed in US Survey Feet. Upon receipt of the
  data, the NOAA Office for Coastal Management (OCM) converted the data for Digital
  Coast storage purposes. The data were converted to geographic coordinates and ellipsoid
  heights, expressed in meters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
